      - reapply: False
        stampType: RubberStamp
        stampedColor: '#4B9DC2FF'
        stampedName: Aultman Industries Safety Board
      content: >2-

        [color=DarkOrange][head=1]Supermatter For Dummies

        [/head]

        [/color]


        Many think the supermatter is a deadly and dangerous method of power generation, and they are only partially correct.

        When properly maintained, the supermatter is no more dangerous than a tesla or singularity engine. All you have to do is follow these simple steps.

        Additional safety information is available at the bottom of this document.


        1: Anchor Nitrogen cans to the connector ports.

        2: Ensure the pump is on, pumping at 1000 L/s, and Nitrogen is exiting the filling area.

        3: Enter into both collection chambers of the supermatter and enable the radiation collectors.

        4: Enter the the supermatter airlock and set the air alarm to:

         Turn off auto mode

         WIDE filtration

         Filter ALL gases

        [color=OrangeRed][bold]DO NOT[/bold][/color] select panic siphon. The panic siphon will prevent new cooling gases from entering the system.

        5: Go to the cooling area north of the engine and set the filter for NITROGEN and set it to ON.

        Ensure gas is flowing properly and is cooling in the space loop.

        6: Once you can ensure cooling gas is properly flowing, enter a chamber and enable the emitter. Close the radiation shutter and repeat with the other chamber.


        The supermatter should now be operating safely.



        [bolditalic]Remember to replenish plasma supplies in radiation collection units and repair tesla coils and grounding rods

        Modifications to the supermatter in any way, including the gas and cooling loop should only be performed by trained technicians.[/bolditalic]

        [color=Red][bolditalic]DO NOT UNDER ANY CIRCUMSTANCES TOUCH THE SUPERMATTER CRYSTAL. YOU WILL BE REDUCED TO A PILE OF ASH.[/bolditalic][/color]


        [color=Red][bolditalic]ALWAYS WEAR RADIATION PROTECTION GEAR WHILE IN PROXIMITY OF THE SUPERMATER[/bolditalic][/color]


        [color=Red][bolditalic]Whenever entering the main chamber, ALWAYS use a holographic fan to prevent gas leaks[/bolditalic][/color]
